import { useState } from "react";
import EmloyeeItem from "./EmployeeItem";
import "./EmployeesList.css";

const data = [
  {
    id: "1",
    f_name: "Gil",
    l_name: "Hatav",
    email: "gil.hatav@gmail.com",
  },
  {
    id: "2",
    f_name: "koko",
    l_name: "KooKoo",
    email: "koko@walla.com",
  },
  {
    id: "3",
    f_name: "Moshe",
    l_name: "Cohen",
    email: "moshe.c@gmail.com",
  },
  
];

const API = 'localhost:8080/api/employee'




function EmployeesList(props) {
  const [employees, setEmployees] = useState(data);

  //Functions
  const getAllEmployees = () => {
    fetch(API)
      .then((response) => {
        console.log(response);
      })
      .then((data) => {
        const extractedData = data.results;
        const sliced = extractedData.slice(0, 25);
        setItunes(sliced);
        setQuery("");
        console.log(sliced);
      });
  };

  return (
    <div>
      <table className="content-table">
        <thead>
          <tr>
            <th>id</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Update</th>
          </tr>
        </thead>
        <tbody>
          {employees.map((employee) => (
            <EmloyeeItem
              id={employee.id}
              f_name={employee.f_name}
              l_name={employee.l_name}
              email={employee.email}
            />
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default EmployeesList;
